function Discover() {
    return (
      <div>
        <h1 className="text-center">Projects</h1>
        <h3 className="text-center">
          Look at all this Great Work!
        </h3>
        <CarouselComponent>
      </CarouselComponent>
      </div>
    );
  };

export default Discover;
